Один из моих самых любимых фильмов про собак. Очень сомневаюсь,что он может  оставить вас равнодушными.
⠀
В фильме мы знакомимся с псом породы золотистый ретривер по кличке Бэйли. Он очень энергичный,преданный,добрый  и игривый пёс. Мы узнаем о том, как он и мальчик,его хозяин, проводят время вместе. Однакокогда мальчик подрос, и  пришло время уезжать в другой город,Бэйли не смог спокойно справиться с этим обстоятельством...
Но на этом история не закончилась, пса ждало ещё огромное количество приключений.
⠀
Была даже снята вторая часть,которая подытожила историю Бэйли. Или не Бэйли? Ведь Бэйли -не единственное имя,которое было дано  псу.  Каждый находит тот образ,который ему ближе. Однако лично  мне больше всего запомнилось именно это воплощение. Просмотр данного фильма стал одной из причин,почему я захотела завести  собаку, а именно золотистого ретривера. Настолько сильно данная история произвела на меня впечатление.
⠀
